q=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.monotonic()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.monotonic()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.monotonic()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.monotonic()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.monotonic()\n            df2.head()\n            stop = time.monotonic()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.monotonic()\n            anom_mean.compute()\n            stop = time.monotonic()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{"axis":{"id":"1119"},"ticker":null,"visible":false},"id":"1122","type":"Grid"},{"attributes":{},"id":"1256","type":"AllLabels"},{"attributes":{"dimensions":"width"},"id":"1139","type":"WheelZoomTool"},{"attributes":{"formatter":{"id":"1242"},"major_label_policy":{"id":"1243"},"ticker":{"id":"1083"},"visible":false},"id":"1082","type":"LinearAxis"},{"attributes":{},"id":"1261","type":"AllLabels"},{"attributes":{},"id":"1252","type":"CategoricalTickFormatter"},{"attributes":{},"id":"1249","type":"AllLabels"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1147"}},"height":{"value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1147"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1168","type":"Rect"},{"attributes":{"active_multi":null,"tools":[{"id":"1090"},{"id":"1091"},{"id":"1092"},{"id":"1093"},{"id":"1105"}]},"id":"1095","type":"Toolbar"},{"attributes":{},"id":"1076","type":"DataRange1d"},{"attributes":{"axis":{"id":"1162"},"dimension":1,"ticker":null},"id":"1164","type":"Grid"},{"attributes":{"start":0},"id":"1181","type":"DataRange1d"},{"attributes":{},"id":"1248","type":"BasicTickFormatter"},{"attributes":{"formatter":{"id":"1230"},"major_label_policy":{"id":"1231"},"ticker":{"id":"1120"}},"id":"1119","type":"DatetimeAxis"},{"attributes":{"axis":{"id":"1193"},"dimension":1,"ticker":null,"visible":false},"id":"1195","type":"Grid"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1094","type":"BoxAnnotation"},{"attributes":{},"id":"1222","type":
